import { formatTimeDisplay, resolveActivityImage } from "utils/discordUtils";

interface CodeProps {
  code: {
    application_id?: string | null;
    assets?: {
      large_image?: string | null;
      small_image?: string | null;
      large_text?: string | null;
    };
    details?: string | null;
    state?: string;
    timestamps?: {
      start?: number;
    };
  };
}
export function Code({ code }: CodeProps) {
  const codeAppId = code?.application_id || "";
  const largeImg = resolveActivityImage(codeAppId, code?.assets?.large_image);

  return (
    <>
      {" "}
      <div className="ds-activity">
        <img
          className="activity-image"
          src={largeImg || undefined}
          alt={code?.details || ""}
        />
        <h3>{code?.details}</h3>
        <h6>{code?.state}</h6>
        <h4>{code?.assets?.large_text}</h4>
        <time>{formatTimeDisplay(code?.timestamps?.start)}</time>
      </div>
    </>
  );
}

export default Code;
